--  DDL for View VIEW_COMPLICAT_V2
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "MADALINA"."VIEW_COMPLICAT_V2" ("PRODUCT_NAME", "NAME", "DANGER_LEVEL") AS 
  SELECT p.product_name, e.name, e.danger_level FROM PRODUCTS p JOIN ENUMBER_PRODUCTS ep ON p.id = ep.products_id JOIN ENUMBER e ON ep.enumber_id = e.id
WHERE p.product_name IN (SELECT p.product_name FROM PRODUCTS p JOIN ALLERGENS_PRODUCTS ap ON p.id = ap.product_id JOIN ALLERGENS a ON ap.allergen_id = a.id)
ORDER BY e.danger_level;
