  CREATE OR REPLACE PACKAGE BODY "MADALINA"."DISEASESPACKAGE" AS
      FUNCTION exista_boala (p_disease_name diseases.disease_name%TYPE)
      return NUMBER AS
          v_contor NUMBER;
      BEGIN
          SELECT COUNT (id) INTO v_contor FROM DISEASES WHERE disease_name = p_disease_name;
          IF v_contor = 0 THEN
              RETURN 0; --boala nu exista
          ELSE
              RETURN 1; --boala exista
          END IF;
      END exista_boala;

      PROCEDURE addDisease (p_disease_name diseases.disease_name%type, p_description diseases.description%type, p_salt diseases.salt%type, p_sugar diseases.sugar%type, p_fats diseases.fats%type, p_carbs diseases.carbohydrate%type, p_fiber diseases.fiber%type, p_protein diseases.protein%type, p_calories diseases.calories%type, p_saturates diseases.saturates%type)
      AS
        p_id NUMBER;
        BEGIN
              SELECT id + 1 INTO p_id FROM (SELECT id FROM diseases ORDER BY id DESC) WHERE ROWNUM <= 1 ORDER BY id DESC;

              EXCEPTION
              WHEN DUP_VAL_ON_INDEX THEN
                  DBMS_OUTPUT.PUT_LINE(SQLERRM);
                  DBMS_OUTPUT.PUT_LINE('Boala exista in baza de date!');
      END addDisease;

      PROCEDURE deleteDisease (p_disease_name diseases.disease_name%type, p_description diseases.description%type)
      AS
          boala_existenta EXCEPTION;
          PRAGMA EXCEPTION_INIT(boala_existenta, -20001);
      BEGIN
          IF exista_boala(p_disease_name) = 1 THEN
             DELETE FROM DISEASES WHERE disease_name = p_disease_name;
          ELSE
             raise boala_existenta;
          END IF;

          EXCEPTION
          WHEN boala_existenta THEN
              raise_application_error (-20001, 'Boala nu exista in baza de date!');
      END deleteDisease;

      PROCEDURE updateDisease (p_disease_name diseases.disease_name%type, p_description diseases.description%type, p_salt diseases.salt%type, p_sugar diseases.sugar%type, p_fats diseases.fats%type, p_carbs diseases.carbohydrate%type, p_fiber diseases.fiber%type, p_protein diseases.protein%type, p_calories diseases.calories%type, p_saturates diseases.saturates%type)
      AS
          v_description diseases.description%type;
          v_salt diseases.salt%type;
          v_sugar diseases.sugar%type;
          v_fats diseases.fats%type;
          v_carbs diseases.carbohydrate%type;
          v_fiber diseases.fiber%type;
          v_protein diseases.protein%type;
          v_calories diseases.calories%type;
          v_saturates diseases.saturates%type;
      BEGIN
          IF exista_boala(p_disease_name) = 1 THEN
              SELECT description, salt, sugar, fats, carbohydrate, fiber, protein, calories,saturates INTO v_description, v_salt, v_sugar, v_fats, v_carbs, v_fiber, v_protein, v_calories, v_saturates FROM DISEASES WHERE disease_name = p_disease_name;

              IF p_description is not null THEN
                  v_description := p_description;
              END IF;

              IF p_salt is not null THEN
                  v_salt := p_salt;
              END IF;

              IF p_sugar is not null THEN
                  v_sugar := p_sugar;
              END IF;

              IF p_fats is not null THEN
                  v_fats := p_fats;
              END IF;

              IF p_carbs is not null THEN
                  v_carbs := p_carbs;
              END IF;

              IF p_fiber is not null THEN
                  v_fiber := p_fiber;
              END IF;

              IF p_protein is not null THEN
                  v_protein := p_protein;
              END IF;

              IF p_calories is not null THEN
                  v_calories := p_calories;
              END IF;

              IF p_saturates is not null THEN
                  v_saturates := p_saturates;
              END IF;

              UPDATE DISEASES SET description = v_description, salt = v_salt, sugar = v_sugar, fats = v_fats, carbohydrate = v_carbs, fiber = v_fiber, protein = v_protein, calories = v_calories, saturates = v_saturates WHERE disease_name = p_disease_name;
         ELSE
              addDisease(p_disease_name, p_description, p_salt, p_sugar, p_fats, p_carbs, p_fiber, p_protein, p_calories, p_saturates);
         END IF;

      END updateDisease;

END diseasesPackage;

