  CREATE OR REPLACE PACKAGE BODY "MADALINA"."ENUMBER_PACK" AS
  PROCEDURE ENUMBER_DISTRIBUTION (p_distribution OUT DISTRIBUTION_ARRAY) AS
    v_count NUMBER;
    v_enumber_id VARCHAR2(10);--enumber.id%type;
    v_product_id products.id%type;
    v_product_count number;
    CURSOR curs is select * from enumber_products;
    TYPE line IS TABLE OF enumber_products%ROWTYPE;
    lista line;
    CURSOR e_curs is select * from enumber;
    linie_enumber e_curs%ROWTYPE;
  BEGIN
    SELECT count(*) into v_product_count from products;

      for linie_enumber in e_curs loop
        p_distribution (linie_enumber.id) := 0;
      END LOOP;

    OPEN curs;
      SELECT * BULK COLLECT INTO lista FROM enumber_products;
    close curs;

    for i in lista.first..lista.last loop
      if lista.exists(i) then
        p_distribution(lista(i).enumber_id) := p_distribution(lista(i).enumber_id)+1;
      end if;
    end loop;

    for linie_enumber in e_curs loop
      UPDATE ENUMBER SET DISTRIBUTION = trunc(p_distribution(linie_enumber.id)*100 / v_product_count, 2) WHERE ID=linie_enumber.id;
    END LOOP;

  END ENUMBER_DISTRIBUTION;
END ENUMBER_PACK;

