--------------------------------------------------------
--  DDL for Procedure RECOMANDARI_PRODUS
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "MADALINA"."RECOMANDARI_PRODUS" (p_user_id NUMBER, p_produs_id OUT NUMBER) AS
    v_random_number NUMBER;
    v_count_produse NUMBER;
BEGIN
    SELECT COUNT(1) INTO v_count_produse FROM PRODUCTS;
    p_produs_id := 0;
    WHILE (p_produs_id = 0) LOOP
      v_random_number := TRUNC(DBMS_RANDOM.VALUE(1, v_count_produse + 1));
      
      IF USERPACKAGE.VALIDATE_PRODUCT(v_random_number, p_user_id) = 1 AND USERPACKAGE.VALIDATE_PRODUCT_ALLERGENS(v_random_number, p_user_id) = 1 THEN
          p_produs_id := v_random_number;
      END IF;
    END LOOP;
END;

